import React  from "react";
import axios from 'axios';


const Pizza = props =>{
    const [data, setData] = React.useState([]);
    React.useEffect(()=>{
        axios('http://localhost:5000/pizza')
        .then(response=>{
            if(response.status===200){
                const fetchedData =response.data.rows;
                console.log(fetchedData);
                setData(fetchedData);
            }
        })
        .catch(err=>{
            console.log(err);
        })
    },[]);

    const test = () => {
        console.log('TEST')
        axios('http://localhost:5000/pizza')
            .then(response=>{
                if(response.status===200){
                    const fetchedData =response.data.rows;
                    console.log(fetchedData);
                    setData(fetchedData);
                    return (
                        <div>{fetchedData}</div>
                    )
                }
            })
            .catch(err=>{
                console.log(err);
            })
    }

    return(<div>
        Pizza Component
        {
            data.length>0 &&
            data.map((item,index)=>
            <div key={index}>{index}-{item}</div>)
        }
        <button id='button' onClick={test}>TEST</button>
    </div>)
}

export default Pizza;
